import { Button, Typography } from "@mui/material";
import { Box } from "@mui/system";
import { useDispatch, useSelector } from "react-redux";
import { useHistory } from "react-router";
import { LinearProgress } from '@mui/material';
import { handleLimitChange, handleScoreChnage, userAnswers } from "../Redux/action";
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import { useEffect } from "react";

const Final = () => {
  const disptach = useDispatch();
  const history = useHistory();

  const { question_difficulty, name, question_limit, question_category, score, question_answers, user_answers, } = useSelector((state) => state);

  useEffect(() => {
    const userResult = {

    }
  }, [])

  const handleBackToSettings = () => {
    disptach(handleScoreChnage(0));
    disptach(handleLimitChange(0));
    history.push("/");
  };
  let percentageValue = ((score / question_answers.length) * 100).toFixed(0);

  return (
    <Box mt={30}>
      {console.log("final answers : ", user_answers)}
      <Card sx={{ minWidth: 275 }}>
        <CardContent>
          <Typography variant="h3" fontWeight="bold" mb={3}>
            Final Score {score}
          </Typography>
          <Typography variant="h3" fontWeight="bold" mb={3}>
            Your Percentage : {percentageValue + "%"}
          </Typography>
        </CardContent>
        <CardActions sx={{ justifyContent: "center" }}>
          <Button onClick={handleBackToSettings} variant="outlined">
            back to settings!
          </Button>
        </CardActions>
      </Card>
    </Box>

  );
};

export default Final;
